Ys.parameters={...Ys.parameters,docs:{...(Z0=Ys.parameters)==null?void 0:Z0.docs,source:{originalSource:`{
  args: {
    title: "Contact Information Form",
    fields: [{
      name: "firstName",
      label: "First Name",
      type: "text",
      placeholder: "Enter your first name",
      validation: {
        required: true,
        minLength: 2
      },
      width: "half",
      isRequired: true
    }, {
      name: "lastName",
      label: "Last Name",
      type: "text",
      placeholder: "Enter your last name",
      validation: {
        required: true
      },
      width: "half",
      isRequired: true
    }, {
      name: "email",
      label: "Email Address",
      type: "text",
      placeholder: "john@example.com",
      validation: {
        required: true,
        pattern: /^[^\\s@]+@[^\\s@]+\\.[^\\s@]+$/
      },
      isRequired: true
    }, {
      name: "role",
      label: "Role",
      type: "select",
      placeholder: "Select your role",
      options: [{
        label: "Frontend Developer",
        value: "frontend"
      }, {
        label: "Backend Developer",
        value: "backend"
      }, {
        label: "Full Stack Developer",
        value: "fullstack"
      }, {
        label: "DevOps Engineer",
        value: "devops"
      }],
      isRequired: true
    }, {
      name: "bio",
      label: "Bio",
      type: "textarea",
      placeholder: "Tell us about yourself...",
      description: "Brief description about your experience"
    }],
    onSubmit: (data: any) => {
      console.log("Form submitted:", data);
      alert("Form submitted! Check console for data.");
    },
    submitLabel: "Submit Application",
    cancelLabel: "Reset"
  }
}`,...(X0=(I0=Ys.parameters)==null?void 0:I0.docs)==null?void 0:X0.source}}};var V0,B0,z0;Gs.parameters={...Gs.parameters,docs:{...(V0=Gs.parameters)==null?void 0:V0.docs,source:{originalSource:`{
  args: {
    title: "Advanced Form Showcase",
    fields: [{
      name: "language",
      label: "Programming Language",
      type: "select",
      options: [{
        label: "JavaScript",
        value: "JavaScript"
      }, {
        label: "Python",
        value: "Python"
      }, {
        label: "SQL",
        value: "SQL"
      }],
      defaultValue: "JavaScript"
    }, {
      name: "code",
      label: "Code Snippet",
      type: "code",
      placeholder: "Enter your code here...",
      description: "Code editor with syntax highlighting"
    }, {
      name: "description",
      label: "Rich Text Description",
      type: "richtext",
      placeholder: "Write a detailed description..."
    }, {
      name: "tags",
      label: "Skills Tags",
      type: "tags",
      description: "Search and select relevant skills"
    }, {
      name: "themeColor",
      label: "Brand Color",
      type: "color",
      defaultValue: "#2C42FF"
    }, {
      name: "isPublic",
      label: "Make Profile Public",
      type: "switch",
      defaultValue: false
    }, {
      name: "assignedUsers",
      label: "Team Members",
      type: "user-select",
      description: "Select team members for this project"
    }],
    onSubmit: (data: any) => console.log("Advanced form:", data)
  }
}`,...(z0=(B0=Gs.parameters)==null?void 0:B0.docs)==null?void 0:z0.source}}};const TI=["ContactForm","AdvancedForm"];export{Gs as AdvancedForm,Ys as ContactForm,TI as __namedExportsOrder,PI as default};
